#include "zetnet.h"


#define HTTP_SERVER_DEFAULT_PORT 8081

void MyCustomHttpServer_OnGetUserRequest(HttpServer *http_server, SocketClient *socket_client, HttpParamValue  * param, size_t param_len,void *data){
	ZN_UNUSUED_PARAM(data);


	char returning_value[1024]= "{\"status\":false, \"msg\":\"unknow value\"}";


	if (param!=NULL && param_len>0)
	{
		if (strcmp(param[0].name,"cmd")==0)
		{
			if(strcmp(param[0].value,"text")==0){
				sprintf(returning_value,"{\"status\":ok, \"msg\":\"message ok\"}");
			}
			else{
				sprintf(returning_value, "{\"status\":false, \"msg\":\"unknow value  %s for cmd value\"}",param[0].name);
			}

		}else{
			sprintf(returning_value, "{\"status\":false, \"msg\":\"unknow cmd %s\"}",param[0].name);
		}
	}

	HttpResponse *resp = HttpResponse_MakeFromString(returning_value, "application/json");

	HttpResponse_Post(resp,socket_client->socket, http_server);

	HttpResponse_Delete(resp);

}

int main(int argc, char *argv[])
{
	char path[MAX_PATH]={"."};
	int port=HTTP_SERVER_DEFAULT_PORT;
	bool send_same_site_attribute=false;
	bool error=false;

	for(int i=1; i < argc && !error; i++){
		zn_list *l=zn_str_split(argv[i],'=');
		switch(l->count){
		case 1:
			if(strcmp(l->items[0],"--send_same_site_attribute")==0){
				send_same_site_attribute=true;
			}else{
				fprintf(stderr,"\nunknow option %s",(const char *)l->items[0]);
				error=true;
			}
			break;
		case 2:
			if(strcmp(l->items[0],"--port")==0){
				error=!zn_str_to_int(&port,l->items[1],10);
			}else if(strcmp(l->items[0],"--path")==0){
				strcpy(path,(const char *)l->items[1]);
			}else{
				fprintf(stderr,"\nunknow option %s",(const char *)l->items[0]);
				error=true;
			}
			break;
		}

		zn_list_delete_and_free_all_items(l);
	}

	if(error){
		return -1;
	}

	ZetNet_Init();

	HttpServer *http_server = HttpServer_New(path,"httpservercpp_demo");
	http_server->send_same_site_attribute=send_same_site_attribute;

	//http_server->logo_base64="data:image/png;base64,";
	http_server->on_get_user_request=(HttpServerOnGetUserRequest){
		.callback_function=MyCustomHttpServer_OnGetUserRequest
		,.user_data=NULL
	};
	if(HttpServer_Start(http_server,port)){

		printf("press any key to stop http_server...\n");
		getchar();
	}

	printf("shutdown...\n");

	HttpServer_Delete(http_server);

	ZetNet_DeInit();

	return 0;
}
